import React, { useState, useEffect } from 'react';
import PropTypes from 'prop-types';
import Button from '../../atoms/Button';
import TextTitle from '../../atoms/TextTitle';
import { findByName } from '../../../http/cliente';

export default function ClientList({ customers, name }) {
  const [allCustomers, setAllCustomers] = useState([]);
  const [customerName, setCustomerName] = useState('');

  function fetchAllCustomers() {
    setCustomerName(name);
    const customer = findByName(customerName);
    setAllCustomers(customer);
  }

  useEffect(() => {
    fetchAllCustomers(name);
  });

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Clientes</th>
          </tr>
        </thead>
        <tbody>
          {customers.map((e, index) => (
            <tr key={ index }>
              <td>
                <TextTitle>
                  {e.nmCliente}
                </TextTitle>
              </td>
              <Button />
              <Button />
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

ClientList.propTypes = {
  customers: PropTypes.node.isRequired,
  name: PropTypes.string.isRequired,
};
